{% image "background_image" label='Select a background image <a href="http://www.webcanopystudio.com/prelude-documentation" target="_blank">Click Here For Documentation - Password: prelude</a>', 
src='http://cdn2.hubspot.net/hubfs/395201/Karaoke-New-York.jpg', no_wrapper=True, 
export_to_template_context=True %}

<style>

.background-header {
    background-image:url("{{widget_data.background_image.src }}");
    background-repeat: no-repeat;
    background-position: center top;
    background-attachment:scroll;
    background-size: cover;
}
</style>

{% color "site_color_picker" label='Site Color Picker', color='#ff8000', no_wrapper=True, export_to_template_context=True %}
<style type="text/css">
.header-color-overlay {
    background: rgba({{ widget_data.site_color_picker.color|convert_rgb }}, .7);
}
.hs-button{
    background-color: {{ widget_data.site_color_picker.color }};
}
.hs-button.primary {
    background-color: {{ widget_data.site_color_picker.color }};
}
.content-text ul li:before {
  color: {{ widget_data.site_color_picker.color }};
}
a:link {
    text-decoration: none;
    color: {{ widget_data.site_color_picker.color }};
}
a:visited {
    text-decoration: none;
    color: {{ widget_data.site_color_picker.color }};
}
a:active {
    text-decoration: none;
    color: {{ widget_data.site_color_picker.color }};
}
a:hover {
    text-decoration: none;
    color:  rgba({{ widget_data.site_color_picker.color|convert_rgb }}, .7);
}
body .hs-button:hover{
    background: none repeat scroll 0 0 rgba({{ widget_data.site_color_picker.color|convert_rgb }}, .7);
    color: #FFFFFF;
}
</style>

{% boolean "image_color_overlay" label='Include Image Color Overlay', value=True, no_wrapper=True, export_to_template_context=True %}

{% if widget_data.image_color_overlay.value == 'true' %}
<style type="text/css">
.header-color-overlay {
    background: rgba({{ widget_data.site_color_picker.color|convert_rgb }}, .7);
}
</style>
{% elif widget_data.image_color_overlay.value == 'false' %}
<style type="text/css">
.header-color-overlay {
    background: rgba(0,0,0,0);
}
</style>
{% endif %}

{% boolean "bullet_points" label='Toggle Bullet Points', value=True, no_wrapper=True, export_to_template_context=True %}

{% if widget_data.bullet_points.value=='true' %}
<style type="text/css">
.content-text ul {
    list-style-type: none;
}
.content-text ul li {
    padding-left: 40px;
    margin-bottom: 25px;
    min-height:30px;
    position: relative;
}
.content-text ul li:before {
  content: "\{{ bulletIcon }}";
}
</style>
{% endif %}

{% if widget_data.bullet_points.value=='false' %}
<style type="text/css">
.content-text ul {
    list-style-type: disc;
}
.content-text ul li {
    padding-left: 0;
    margin-bottom: 25px;
    min-height:0;
    position: relative;
}
.content-text ul li:before {
  content: none;
}
</style>
{% endif %}

{% color "secondary_color_picker" label='Secondary Color Picker', color='#ff8000', no_wrapper=True, export_to_template_context=True %}

<style type="text/css">
